.wrapper.hidden {
    display: none;
}

.wrapper.visible {
    display: block;
    visibility: visible;
}

.wrapper .desktop-top {
    position: fixed;
    top: 0;
    right: 39px;
    border-top: solid 2px #459fed;
    border-bottom-left-radius: 10px;
    border-bottom-right-radius: 10px;
    transition: height 100ms;
    cursor: pointer;
    overflow: hidden;
    color: #ffffff;
    display: block;
    font-family: wixFreemiumFontW01-55Roma, wixFreemiumFontW02-55Roma,
        wixFreemiumFontW10-55Roma, Helvetica Neue, Helvetica, Arial, メイリオ,
        meiryo, ヒラギノ角ゴ pro w3, hiragino kaku gothic pro, sans-serif;
    letter-spacing: 0.05em;
    font-size: 13px;
    z-index: 999;
}
.wrapper .desktop-top:hover {
    min-height: 72px;
    background-color: #43515c;
    padding-bottom: 6px;
    word-wrap: break-word;
}
.wrapper .desktop-top:hover > .hover1 {
    display: block;
    font-family: wixFreemiumFontW01-35Thin, wixFreemiumFontW02-35Thin,
        wixFreemiumFontW10-35Thin, Helvetica Neue, Helvetica, Arial, メイリオ,
        meiryo, ヒラギノ角ゴ pro w3, hiragino kaku gothic pro, sans-serif;
    padding-top: 4px;
}
.wrapper .desktop-top:hover > .arrow,
.wrapper .desktop-top:hover > .hover2 {
    display: inline-block;
}
.wrapper .desktop-top > .main {
    padding: 0 6px 0 10px;
    text-align: center;
    line-height: 26px;
    border-bottom-left-radius: 10px;
    border-bottom-right-radius: 10px;
    background-color: #20303c;
}
.wrapper .desktop-top > .main > .banner1,
.wrapper .desktop-top > .main > .wix,
.wrapper .desktop-top > .main > .banner2,
.wrapper .desktop-top > .main > .arrow {
    display: inline-block;
}
.wrapper .desktop-top > .main > .wix {
    fill: #fff;
    width: 28px;
    height: 14px;
    padding: 0 1px 4px 1px;
    vertical-align: middle;
}
.wrapper .desktop-top > .main > .wix > .dot {
    fill: #fc0;
}
.wrapper .desktop-top > .hover1,
.wrapper .desktop-top > .hover2 {
    padding-left: 14px;
    line-height: 20px;
    display: none;
}
.wrapper .desktop-top > .hover2 {
    color: #459fed;
    padding-right: 4px;
}
.wrapper .desktop-top > .arrow {
    display: none;
    fill: none;
    stroke: #459fed;
    stroke-miterlimit: 10;
    stroke-width: 2px;
    height: 10px;
    width: 6px;
    padding-bottom: 5px;
    vertical-align: bottom;
}

.wrapper .desktop-bottom {
    position: fixed;
    width: 100%;
    height: 40px;
    background-color: #20303c;
    bottom: 0;
    max-height: 10vh;
    color: #ffffff;
    font-size: 14px;
    display: inline-block;
    line-height: 40px;
    text-align: center;
    letter-spacing: 0.05em;
    align-items: center;
    font-family: wixFreemiumFontW01-55Roma, wixFreemiumFontW02-55Roma,
        wixFreemiumFontW10-55Roma, Helvetica Neue, Helvetica, Arial, メイリオ,
        meiryo, ヒラギノ角ゴ pro w3, hiragino kaku gothic pro, sans-serif;
    transition: background-color 150ms;
    cursor: pointer;
    z-index: 999;
}
.wrapper .desktop-bottom.preview {
    cursor: default;
}
.wrapper .desktop-bottom:not(.preview):hover {
    background-color: #43515c;
}
.wrapper .desktop-bottom > .contents .wix-logo {
    fill: #fff;
    width: 36px;
    vertical-align: middle;
    padding-bottom: 6px;
    height: 16px;
}
.wrapper .desktop-bottom > .contents .wix-logo > .dot {
    fill: #fc0;
}
.wrapper .desktop-bottom > .contents .com {
    color: #ffffff;
}
.wrapper .desktop-bottom > .contents > .arrow {
    fill: none;
    stroke: #459fed;
    stroke-miterlimit: 10;
    stroke-width: 2px;
    height: 10px;
    padding-bottom: 1px;
    vertical-align: middle;
}
.wrapper .desktop-bottom > .contents > .second {
    color: #459fed;
    padding: 0 5px 0 6px;
}

@media (orientation: landscape) and (max-width: 600px) {
    .wrapper .mobile-top.not-preview {
        display: none;
    }
}

.wrapper .mobile-top {
    position: relative;
    display: block;
    height: 38px;
    top: 0px;
    width: 100%;
    font-family: wixFreemiumFontW01-65Medi, wixFreemiumFontW02-65Medi,
        wixFreemiumFontW10-65Medi, Helvetica Neue, Helvetica, Arial, メイリオ,
        meiryo, ヒラギノ角ゴ pro w3, hiragino kaku gothic pro, sans-serif;
    letter-spacing: 0.05em;
    font-size: 14px;
    color: #ffffff;
    background-color: #20303c;
    z-index: 999;
    text-align: center;
    cursor: default;
}
.wrapper .mobile-top.fixed-ad-mobile {
    position: fixed;
    width: 320px;
    z-index: 1000;
}
.wrapper .mobile-top > .first {
    display: inline-block;
    text-align: center;
    line-height: 38px;
}
.wrapper .mobile-top .wix-logo {
    fill: #fff;
    width: 30px;
    padding-bottom: 4px;
    vertical-align: middle;
    height: 15px;
}
.wrapper .mobile-top .wix-logo > .dot {
    fill: #fc0;
}

 
